// src/middlewares/requireAuth.ts
var requireAuth = (app) => app.derive(async ({ cookie, headers }) => {
  let token = typeof cookie?.auth?.value === "string" ? cookie.auth.value : "";
  if (!token) {
    const authHeader = headers.authorization;
    if (authHeader && authHeader.startsWith("Bearer ")) {
      token = authHeader.substring(7);
    }
  }
  if (!token) {
    return { user: null };
  }
  const payload = await jwtUtils.verifyToken(token);
  if (!payload) {
    return { user: null };
  }
  return { user: payload };
}).onBeforeHandle(({ user, set: set2 }) => {
  if (!user) {
    set2.status = 401;
    return wrapResponse(null, 401, "", "Unauthorized - Authentication required");
  }
});

