var selectRoomColumns = {
  uuid: rooms.uuid,
  code: rooms.code,
  name: rooms.name,
  openTime: rooms.openTime,
  closeTime: rooms.closeTime,
  createdBy: rooms.createdBy,
  createdAt: rooms.createdAt,
  updatedAt: rooms.updatedAt
};
var formatRoom = (room) => ({
  uuid: room.uuid,
  code: room.code,
  name: room.name,
  openTime: room.openTime?.toISOString() ?? null,
  closeTime: room.closeTime?.toISOString() ?? null,
  createdBy: room.createdBy,
  createdAt: room.createdAt?.toISOString() ?? null,
  updatedAt: room.updatedAt?.toISOString() ?? null
});
var roomService = {
  createRoom: async ({ body, user, set: set2 }) => {
    const { name, openTime, closeTime, options } = body;
    const code = Math.random().toString(36).substring(2, 8).toUpperCase();
    const [existingRoom] = await db.select(selectRoomColumns).from(rooms).where(eq(rooms.code, code));
    if (existingRoom) {
      set2.status = 409;
      return wrapResponse(null, 409, "", "Room code collision, please try again");
    }
    const newUuid = crypto.randomUUID();
    const parsedOpenTime = new Date(openTime.replace(" ", "T"));
    const parsedCloseTime = new Date(closeTime.replace(" ", "T"));
    if (parsedOpenTime >= parsedCloseTime) {
      set2.status = 400;
      return wrapResponse(null, 400, "", "Open time must be before close time");
    }
    await db.insert(rooms).values({
      uuid: newUuid,
      code,
      name,
      openTime: isNaN(parsedOpenTime.getTime()) ? null : parsedOpenTime,
      closeTime: isNaN(parsedCloseTime.getTime()) ? null : parsedCloseTime,
      createdBy: user.userId
    });
    const response = {
      status: 201,
      description: "Room created successfully"
    };
    return wrapResponse(response, 201, "Room created successfully");
  },
  getRooms: async ({ user }) => {
    const roomList = await db.select(selectRoomColumns).from(rooms).where(eq(rooms.createdBy, user.userId));
    return wrapResponse(roomList.map(formatRoom), 200, "Rooms retrieved successfully");
  },
  getAllRooms: async () => {
    const roomList = await db.select(selectRoomColumns).from(rooms);
    return wrapResponse(roomList.map(formatRoom), 200, "All rooms retrieved successfully");
  },
  getRoomById: async ({ params, user, set: set2 }) => {
    const { id } = params;
    const [room] = await db.select(selectRoomColumns).from(rooms).where(eq(rooms.uuid, id));
    if (!room) {
      set2.status = 404;
      return wrapResponse(null, 404, "", "Room not found");
    }
    return wrapResponse(formatRoom(room), 200, "Room retrieved successfully");
  },
  updateRoom: async ({ params, body, user, set: set2 }) => {
    const { id } = params;
    const { name, openTime, closeTime } = body;
    const [room] = await db.select(selectRoomColumns).from(rooms).where(eq(rooms.uuid, id));
    if (!room) {
      set2.status = 404;
      return wrapResponse(null, 404, "", "Room not found");
    }
    if (room.createdBy !== user.userId) {
      set2.status = 403;
      return wrapResponse(null, 403, "", "Forbidden - You are not the owner of this room");
    }
    const updateValues = { updatedAt: new Date };
    if (name !== undefined)
      updateValues.name = name;
    let parsedOpenTime = openTime !== undefined ? new Date(openTime.replace(" ", "T")) : null;
    let parsedCloseTime = closeTime !== undefined ? new Date(closeTime.replace(" ", "T")) : null;
    const currentOpenTime = parsedOpenTime ?? room.openTime;
    const currentCloseTime = parsedCloseTime ?? room.closeTime;
    if (currentOpenTime && currentCloseTime && currentOpenTime >= currentCloseTime) {
      set2.status = 400;
      return wrapResponse(null, 400, "", "Open time must be before close time");
    }
    if (parsedOpenTime !== null) {
      updateValues.openTime = isNaN(parsedOpenTime.getTime()) ? null : parsedOpenTime;
    }
    if (parsedCloseTime !== null) {
      updateValues.closeTime = isNaN(parsedCloseTime.getTime()) ? null : parsedCloseTime;
    }
    await db.update(rooms).set(updateValues).where(eq(rooms.uuid, id));
    const response = {
      message: "success"
    };
    return wrapResponse(response, 200, "Room updated successfully");
  },
  deleteRoom: async ({ params, user, set: set2 }) => {
    const { id } = params;
    const [room] = await db.select(selectRoomColumns).from(rooms).where(eq(rooms.uuid, id));
    if (!room) {
      set2.status = 404;
      return wrapResponse(null, 404, "", "Room not found");
    }
    if (room.createdBy !== user.userId) {
      set2.status = 403;
      return wrapResponse(null, 403, "", "Forbidden - You are not the owner of this room");
    }
    await db.delete(rooms).where(eq(rooms.uuid, id));
    return wrapResponse(null, 200, "Room deleted successfully");
  }
};

