    const [user] = await db.select().from(accounts).where(eq(accounts.uuid, userId));
    if (!user) {
      set2.status = 404;
      return wrapResponse(null, 404, "", "User not found");
    }
    if (user.isBanned === 0) {
      set2.status = 400;
      return wrapResponse(null, 400, "", "User is not banned");
    }
    await db.update(accounts).set({ isBanned: 0, updatedAt: new Date }).where(eq(accounts.uuid, userId));
